script: |
  super -f text -I q9638.spq | sort > q9638.out

inputs:
  - name: q9638.spq
    data: |
      SELECT DISTINCT - col0 - - col2 + CAST ( NULL AS REAL ) * col2 AS col2 FROM tab2 (FORMAT parquet) WHERE NOT NULL NOT IN ( - 35 + - 29, + col1 + col0 + - - col1 );
  - name: tab2

outputs:
  - name: q9638.out
    data: |
